'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
//@@DocBrief("The command for getting instrument descriptors")
class GetInstrumentDescriptorsCommand extends SendSingleCommandWithoutResponse {
    constructor() {
        super();
        this.commandName = "GetInstrumentDescriptorsCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createGetInstrumentDescriptorsRequestMessage(this.tradingSession, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = GetInstrumentDescriptorsCommand
